questionvariables.text:
dp(x, n) := float(round((x+10^(-8))*10^n)/10^n);

light_df:1 ;
heat_df: 1;
variety_df: 1;
total_df: 23;
resid_df: total_df-heat_df-light_df-variety_df;

light_ss: dp(float((rand(10)/10)+(rand(6)+5)),1);
heat_ss: dp(float((rand(10)/10)+(rand(10)+40)),1);
variety_ss: dp(float((rand(10)/10)+(rand(6)+3)+light_ss),1);
resid_ss: dp(float((rand(10)/10)+(rand(20)+95)),1);
total_ss: dp(light_ss+heat_ss+variety_ss+resid_ss,1);

light_ms: dp(light_ss/light_df,1);
heat_ms: dp(heat_ss/heat_df,1);
variety_ms: dp(variety_ss/variety_df,1);
resid_ms: dp(resid_ss/resid_df,1);

light_f: dp(light_ms/resid_ms,1);
heat_f: dp(heat_ms/resid_ms,1);
variety_f: dp(variety_ms/resid_ms,1);

ta1:variety_df;
ta2:resid_df;
ta3:resid_ss;
ta4:light_ms;
ta5:heat_ms;
ta6:variety_ms;
ta7:resid_ms;
ta8:light_f;
ta9:heat_f;
ta10:variety_f;
